CREATE TABLE public.customer_policy (
	id bigint NOT NULL,
	customer_id int4 NULL,
	agency_id int4 NULL,
	policy_id varchar(50) NULL,
	"date" date NULL,
	insurance_amount numeric(8, 2) NULL,
	is_active varchar(50) NULL,
	CONSTRAINT customer_policy_pk PRIMARY KEY (id)
);

ALTER TABLE public.customer_policy ADD CONSTRAINT customer_policy_fk FOREIGN KEY (agency_id) REFERENCES public.agency(id);
ALTER TABLE public.customer_policy ADD CONSTRAINT customer_policy_fk_1 FOREIGN KEY (customer_id) REFERENCES public.customer(id);
ALTER TABLE public.customer_policy ADD CONSTRAINT customer_policy_fk_2 FOREIGN KEY (policy_id) REFERENCES public.policy(id);

